import React, { Component } from 'react';
import './Todo.css';

class Todo extends Component {
	
	constructor(props){
		super(props)
		this.state = {
			length: 1,
			jobs: [
				<input type="text" placeholder="o_O ?" className="inp1"/>
			]
		}
	}
	
	routeChange = () => {
		this.props.onRouteChange('timeTable');
	}
	
	render() {
		return(
			<div>
				<div className='jobsList'>
					{this.state.jobs}
				</div>
				<div className='float dib bw2 grow shadow-5'onClick={this.routeChange}>
					<p className='my-float'>Time-Table</p>
				</div>
			</div>
		);
	}
}

export default Todo;
